import Breath from './breath/Breath';
import Faces from './faces/Faces';

class Project {
    constructor(title, summary, description, element) {
        this.title=title;
        this.summary=summary;
        this.description=description;
        this.element=element;
    }
}

const projects = {
    1: Breath,
    2: Faces,
}

export {Project, projects};
